import React from 'react';

import './App.css';
import { postCsv } from '../../services/CsvService.js';
import FileInput from '../FileInput/FileInput';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      file: null,
      pictures: null,
      batchId: null
    };
  }

  render() {
    const { pictures } = this.state;
    return (
      <div className="App">
        <FileInput file={this.state.file} pictures={this.state.pictures} batchId={this.state.batchId} />


          { "hello world" }

      </div>
    );
  }
}

export default App;
